DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarPedidoCompleto` (IN `pedidoId` INT, IN `nuevoEstado` INT, IN `nuevoProducto` VARCHAR(10), IN `nuevaCantidad` INT, IN `nuevoPrecio` INT, IN `nuevafechaentrega` DATE, IN `nuevaObservacion` VARCHAR(50))   BEGIN
    UPDATE pedido
    SET Pe_Estado = nuevoEstado,
        Pe_Producto = nuevoProducto,
        Pe_Cantidad = nuevaCantidad,
        Pe_Precio = nuevoPrecio,
        Pe_Fechaentrega = nuevafechaentrega,
        Pe_Observacion = nuevaObservacion
    WHERE Pe_Codigo = pedidoId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `EliminarProducto` (IN `codigoProducto` VARCHAR(10))   BEGIN
    DELETE FROM producto WHERE Pro_Codigo = codigoProducto;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertarProducto` (IN `nombreProducto` VARCHAR(50), IN `codigoProducto` VARCHAR(10), IN `descripcionProducto` VARCHAR(255), IN `precioVenta` INT, IN `categoria` INT, IN `cantidad` INT, IN `costo` DECIMAL(10,0))   BEGIN
    INSERT INTO producto (Pro_Nombre, Pro_Codigo, Pro_Descripcion, Pro_PrecioVenta, Pro_Categoria, Pro_Cantidad, Pro_Costo)
    VALUES (nombreProducto, codigoProducto, descripcionProducto, precioVenta, categoria, cantidad, costo);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerDetallesPedido` (IN `pedidoId` INT)   BEGIN
    SELECT pedido.Pe_Codigo, producto.Pro_Nombre, pedido.Pe_Cantidad, producto.Pro_Descripcion, categoria.Cgo_Nombre
    FROM pedido
    INNER JOIN producto ON pedido.Pe_Producto = producto.Pro_Codigo
    INNER JOIN categoria ON producto.Pro_Categoria = categoria.Cgo_Codigo
    WHERE pedido.Pe_Codigo = pedidoId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerDetallesUsuarioYPedidosPorIdentificacion` (IN `userIdentificacion` INT)   BEGIN
    SELECT usuario.Usu_Nombre_completo, usuario.Usu_Email, pedido.Pe_Codigo, pedido.Pe_Fechapedido, pedido_estado.Es_Nombre
    FROM usuario
    INNER JOIN pedido ON usuario.Usu_Identificacion = pedido.Pe_Cliente
    INNER JOIN pedido_estado ON pedido.Pe_Estado = pedido_estado.Es_Codigo
    WHERE usuario.Usu_Identificacion = userIdentificacion;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `VerTodosLosProductos` ()   BEGIN
    SELECT * FROM producto;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `VerTodosLosUsuarios` ()   BEGIN
    SELECT * FROM usuario;
END$$

